let result = document.getElementById('result');
function jbdetect() {
    document.getElementById('container').style.marginTop = "5%";
  let version = document.getElementById('version').value;
  let model = document.getElementById('model').value.match(/\w+/gi).join('')
  let jailbreakNO = `Unfortunately, No.<br />
Get the latest news at<br />
<a target="_blank" href="https://www.reddit.com/r/jailbreak/">reddit.com/r/jailbreak</a>`;
  let jailbreakYes = `Congratulations,You can Jailbreak! <br />
Available Jailbreaks:
<br />`;
  for (let i of phones) {
    if (i.Device.toLowerCase() == model.toLowerCase()) {
      let jailbreaks = i[version];
        if(jailbreaks =='N/A'||jailbreaks == undefined) {
        result.innerHTML = jailbreakNO; 
        return; 
        }
        jailbreaks = jailbreaks.replace(/\'/gi,"\"");
        jailbreaks = jailbreaks.replace(/\`/gi,"'");
        result.innerHTML = jailbreakYes+jailbreaks.split(", ").join("  -  ");
    }
    else{
        continue;
    }
  }
}




















